import React from 'react';

function Navigation() {
    return (
      <div>
        <h1>Navigation</h1>
        <ul>
          <li>GitHub</li>
          <li>LinkedIn</li>
          <li>Stack Overflow</li>
          <li>Dev.to</li>
        </ul>
      </div>
    );
  }
  
  export default Navigation;
